import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import {  useNavigate } from 'react-router-dom';
import axios from 'axios';
import './style.css';
import pdfMake from 'pdfmake/build/pdfmake';
  import pdfFonts from 'pdfmake/build/vfs_fonts';



function NoUpdatesPopup({ onClose }) {
  return (
    <div className="popup">
      <div className="popup-content">
        <h3>No Updates Available</h3>
        <p>There are no updates available for the selected date range.</p>
        <button onClick={onClose}>Close</button>
      </div>
    </div>
  );
}

function ClientDetails() {
  const { clientId } = useParams();
  const [client, setClient] = useState(null);
  const [fromDate, setFromDate] = useState('');
  const [toDate, setToDate] = useState('');
  const [filteredMessages, setFilteredMessages] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(10);
  const [showNoUpdatesPopup, setShowNoUpdatesPopup] = useState(false);
  const [fromDateError, setFromDateError] = useState('');
  const [toDateError, setToDateError] = useState('');
  const navigate = useNavigate();
  

  useEffect(() => {
    axios
      .get(`http://localhost:4000/api/v1/clients/${clientId}/total-sent-messages`)
      .then((response) => {
        setClient(response.data);
        setFilteredMessages(response.data.messages);
      })
      .catch((error) => {
        console.error('Error fetching client details:', error);
      });
  }, [clientId]);

  const handleFilter = () => {
    setFromDateError('');
    setToDateError('');

    if (!fromDate) {
      setFromDateError('Please select a From Date');
      setTimeout(() => {
        setFromDateError('');
      }, 5000);
      return;
    }

    if (!toDate) {
      setToDateError('Please select a To Date');
      setTimeout(() => {
        setToDateError('');
      }, 5000);
      return;
    }

    const fromDateFormatted = new Date(fromDate).toISOString().split('T')[0];
    const toDateFormatted = new Date(toDate).toISOString().split('T')[0];

    if (fromDateFormatted > toDateFormatted) {
      setToDateError('End Date should be greater than or equal to Start Date');
      setTimeout(() => {
        setToDateError('');
      }, 5000);
      return;
    }

    axios
      .get(`http://localhost:4000/api/v1/clients/${clientId}/messages`, {
        params: {
          from: fromDateFormatted,
          to: toDateFormatted,
        },
      })
      .then((response) => {
        const messages = response.data.messages;
        setFilteredMessages(messages);
        setCurrentPage(1);
        if (messages.length === 0) {
          setShowNoUpdatesPopup(true);
          setTimeout(() => {
            setShowNoUpdatesPopup(false);
          }, 5000);
        }
      })
      .catch((error) => {
        console.error('Error fetching filtered messages:', error);
      });
  };

  
  

  
  
  
  pdfMake.vfs = pdfFonts.pdfMake.vfs;
  
  const handleDownload = () => {
    const fromDateFormatted = new Date(fromDate).toLocaleDateString();
    const toDateFormatted = new Date(toDate).toLocaleDateString();
  
    axios
      .get(`http://localhost:4000/api/v1/clients/${clientId}/messages`, {
        params: {
          from: fromDateFormatted,
          to: toDateFormatted,
        },
      })
      .then((response) => {
        const messages = response.data.messages;
  
        // Create a filtered copy of the messages object without 'id' and 'clientId'
        const filteredMessages = messages.map(({ _id, clientId, __v, ...rest }) => rest);
  
        const logoUrl ='data:image/png;base64,';

        // Create a PDF document definition
        const pdfDefinition = {
          content: [
            // Add the logo to the PDF
            { image: logoUrl, width: 100, alignment: 'left' }, // Adjust width and alignment as needed
            { text: `Messages Sent (${fromDateFormatted} to ${toDateFormatted})`, style: 'header' },
            '\n',
            {
              table: {
                headerRows: 1,
                widths: ['auto', 'auto', 'auto', 'auto'],
                body: [
                  ['Sender', 'Recipient', 'Content', 'Timestamp'],
                  ...filteredMessages.map((message) => [
                    message.sender,
                    message.recipient,
                    message.content,
                    new Date(message.timestamp).toLocaleString(),
                  ]),
                ],
              },
            },
          ],
          styles: {
            header: {
              fontSize: 18,
              bold: true,
              alignment: 'center',
              margin: [0, 0, 0, 20],
            },
          },
        };
  
        // Generate the PDF document
        const pdfDoc = pdfMake.createPdf(pdfDefinition);
  
        // Download the PDF
        pdfDoc.download(`messages_${fromDateFormatted}_${toDateFormatted}.pdf`);
      })
      .catch((error) => {
        console.error('Error fetching filtered messages:', error);
      });
  };
  
  
  
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = filteredMessages.slice(indexOfFirstItem, indexOfLastItem);

  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  return (
    <div className="client-details">
      <header className="header">
        <div className="logo">
          <img
            src="https://lh3.googleusercontent.com/p/AF1QipPQVmbzTfYibJVGgymUsbIBblu5U9bwG3rah_6N=s680-w680-h510"
            alt="Inspiron Logo"
          />
        </div>
        <h2>Messages Sent</h2>
        
        </header>

      <div className="date-filter">
        <label htmlFor="fromDate">From Date:</label>
        <input type="date" id="fromDate" onChange={(e) => setFromDate(e.target.value)} />
        {fromDateError && <p className="error">{fromDateError}</p>}
        <label htmlFor="toDate">To Date:</label>
        <input type="date" id="toDate" onChange={(e) => setToDate(e.target.value)} />
        {toDateError && <p className="error">{toDateError}</p>}
        <button onClick={handleFilter}>Apply</button>
        <div className="download">
          <button onClick={handleDownload}>Download</button>
          <div id="jsonDataContainer"></div>
        </div>
      </div>
      
      <table className="messages-table">
        <thead>
          <tr>
            <th>Sender</th>
            <th>Recipient</th>
            <th>Content</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {currentItems.map((message) => (
            <tr key={message._id}>
              <td>{message.sender}</td>
              <td>{message.recipient}</td>
              <td>{message.content}</td>
              <td>{new Date(message.timestamp).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="pagination">
        <button onClick={() => paginate(currentPage - 1)} disabled={currentPage === 1}>
          Previous
        </button>
        {Array.from({ length: Math.ceil(filteredMessages.length / itemsPerPage) }).map((_, index) => (
          <button
            key={index}
            onClick={() => paginate(index + 1)}
            className={currentPage === index + 1 ? 'active' : ''}
          >
            {index + 1}
          </button>
        ))}
        <button
          onClick={() => paginate(currentPage + 1)}
          disabled={currentPage === Math.ceil(filteredMessages.length / itemsPerPage)}
        >
          Next
        </button>
      </div>

      {showNoUpdatesPopup && <NoUpdatesPopup onClose={() => setShowNoUpdatesPopup(false)} />}
    </div>
    
  );
}

export default ClientDetails;
